import smtplib
from email.mime.multipart import MIMEMultipart
from email.mime.text import MIMEText

def send_email(subject, message, to_email):
    gmail_user = 'oculensreport@gmail.com'
    gmail_password = 'padt lsyn ikfm dtuq'  # Use your App Password if 2FA is enabled

    # Create the MIME message
    msg = MIMEMultipart()
    msg['From'] = gmail_user
    msg['To'] = to_email
    msg['Subject'] = subject
    msg.attach(MIMEText(message, 'plain'))

    try:
        # Set up the SMTP server
        server = smtplib.SMTP('smtp.gmail.com', 587)
        server.starttls()  # Secure the connection
        server.login(gmail_user, gmail_password)  # Log in to your Gmail account
        server.sendmail(gmail_user, to_email, msg.as_string())  # Send the email
        server.quit()  # Disconnect from the server
        print("Email sent successfully!")
    except smtplib.SMTPAuthenticationError:
        print("Failed to authenticate. Check your email and password.")
    except Exception as e:
        print(f"Failed to send email: {e}")

